public class 关系运算符 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
System.out.println("5>4:"+(5>4));
System.out.println("5<4:"+(5<4));
System.out.println("5==4:"+(5==4));
System.out.println("5>=4:"+(5>=4));
System.out.println("5<=4:"+(5<=4));
System.out.println("5!=4:"+(5!=4));
System.out.println("4<=5:"+(4<=5));
System.out.println(0.0);
	}

}
